import Login from './Login';
import React from 'react';
import Circle from './Circle';
import { blue } from '@material-ui/core/colors';
import ThumbUp from '@material-ui/icons/ThumbUp';
import DeleteForeverIcon from '@material-ui/icons/DeleteForever';
import {AiOutlineFileAdd,AiOutlineRead} from "react-icons/ai";
import { BiLink,BiUnlink,BiEdit } from "react-icons/bi";
import { CallReceived } from '@material-ui/icons';

import { useState, useEffect } from 'react';

function HomeTab() {
  const itemsFirstRow = 3;
  const itemsSecondRow = 2;
  const sizeOfCircle = 250;
  return (
    <div style={{position:"absolute",display:"flex",flexDirection:"column",width:"95vw",height:"95vh"}}>
        <div style={{display:"flex",flexDirection:"row",flexWrap:"wrap",backgroundColor:"blue",justifyContent:"space-around"}}>
        <Circle diameter={sizeOfCircle} icon={<AiOutlineFileAdd style={{width:100,height:100}}/>} text={"Create a Policy"}/>
        <Circle diameter={sizeOfCircle} icon={<DeleteForeverIcon style={{width:100,height:100}}/>} text={"Delete a Policy"}/>
        <Circle diameter={sizeOfCircle} icon={<AiOutlineRead style={{width:100,height:100}}/>} text={"Read a Policy"}/>
        <Circle diameter={sizeOfCircle} icon={<BiEdit style={{width:100,height:100}}/>} text={"Update a Policy"}/>
        </div>
        <div style={{display:"flex",flexDirection:"row",flexWrap:"wrap",backgroundColor:"blue",justifyContent:"center"}}> 
          <Circle diameter={sizeOfCircle} icon={<BiUnlink style={{width:100,height:100}}/>} text={"Disconnect Policy From Role"}/>
          <div style={{fontSize:10,display:"flex",justifyContent:"center",alignItems:"center"}}>Welcome to Policy Manager</div>
          <Circle diameter={sizeOfCircle} icon={<BiLink style={{width:100,height:100}}/>} text={"Connect a Policy From Role"}/>
        </div>

    </div>
  );
}

export default HomeTab;
